import React from 'react';
import { Table, Typography } from 'antd';
import { useGetCryptoExchangesQuery } from '../services/cryptoApi';

const { Title } = Typography;


const Exchanges = () => {
    const { data, isFetching } = useGetCryptoExchangesQuery(10);
    const exchangesData = data?.data?.exchanges

    if(isFetching) return 'Loading...'


    console.log(exchangesData)

    const columns = [
        { title: 'Exchanges', dataIndex: 'name', key: 'name' },
        { title: '24h Trade Volume', dataIndex: 'age', key: 'age' },
        { title: 'Markets', dataIndex: 'address', key: 'address' },
        { title: 'Change', dataIndex: 'address', key: 'address' },
        {
          title: 'Action',
          dataIndex: '',
          key: 'x',
          render: () => <a>Delete</a>,
        },
      ];


    return (
        <div>
            Exchanges
        </div>
    )
}

export default Exchanges
